import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import "./reset.css";
import { BrowserRouter,Routers,Router} from "react-router-dom";


ReactDOM.render(

  <React.StrictMode>
    <BrowserRouter>
      <Routers>
        <App />
      </Routers>
    </BrowserRouter>
  </React.StrictMode>,

  document.getElementById('root')
);
